import React, { useState } from 'react';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './FreeUser.css';

const FreeUser = () => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);
  const navigate = useNavigate();

  const recentAddresses = [
    { id: 1, address: '789 Clementi Road' },
    { id: 2, address: '101 Pasir Panjang Road' }
  ];

  const bookmarkedAddresses = [
    { id: 1, address: '123 Jurong East Ave 1' },
    { id: 2, address: '456 Tuas South Ave 2' }
  ];

  const predictions = [
    {
      id: 1,
      name: 'B2 Warehouse, Jurong East',
      estimatedValue: '$2.9M',
      image: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      name: 'Factory Building, Tuas',
      estimatedValue: '$1.5M',
      image: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
    }
  ];

  const recommendedProperties = [
    {
      id: 1,
      name: 'Office Space, Central Business District',
      estimatedValue: '$5.2M',
      image: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      name: 'Retail Unit, Orchard Road',
      estimatedValue: '$3.8M',
      image: 'https://images.unsplash.com/photo-1441986300917-64674bd600d8?w=300&h=200&fit=crop'
    }
  ];

  // Get user type from localStorage
  const userType = localStorage.getItem('userType') || 'free';

  const navigationItems = [
    { id: 'dashboard', label: 'Dashboard', icon: 'üè†' },
    { id: 'price-prediction', label: 'Price Prediction', icon: 'üìà' },
    ...(userType === 'premium' ? [{ id: 'compare-predictions', label: 'Compare Predictions', icon: 'üîÑ' }] : []),
    { id: 'bookmarks', label: 'Bookmarks', icon: 'üîñ' },
    { id: 'support', label: 'Support', icon: '‚ùì' },
    { id: 'feedback', label: 'Feedback', icon: 'üí¨' },
    { id: 'profile', label: 'Profile', icon: 'üë§' }
  ];

  const handleProfileClick = () => {
    setShowProfileDropdown(!showProfileDropdown);
  };

  const handleProfilePage = () => {
    setShowProfileDropdown(false);
    navigate('/profile');
  };

  const handleLogout = () => {
    setShowProfileDropdown(false);
    localStorage.removeItem('isLoggedIn');
    localStorage.removeItem('userType');
    localStorage.removeItem('userPreferences');
    navigate('/login');
  };

  const handleClickOutside = (e) => {
    if (!e.target.closest('.user-profile')) {
      setShowProfileDropdown(false);
    }
  };

  const handleNavigation = (itemId) => {
    setActiveTab(itemId);
    
    // Navigate to different pages based on the selected item
    switch (itemId) {
      case 'dashboard':
        // Already on dashboard, no navigation needed
        break;
      case 'price-prediction':
        navigate('/dashboard/priceprediction');
        break;
      case 'bookmarks':
        navigate('/bookmarks');
        break;
      case 'support':
        navigate('/support');
        break;
      case 'feedback':
        navigate('/feedback');
        break;
      case 'profile':
        navigate('/profile');
        break;
      default:
        break;
    }
  };

  // Add click listener to close dropdown when clicking outside
  React.useEffect(() => {
    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, []);

  return (
    <div className="free-user-dashboard">
      {/* Top Header */}
      <header className="dashboard-header">
        <div className="header-center">
          <div className="logo">
            <span className="logo-icon">üè†</span>
            <span className="logo-text">Valuez</span>
          </div>
        </div>
        <div className="header-right">
          <div className="notification-icon">üîî</div>
          <div className="user-profile">
            <img 
              src="https://images.unsplash.com/photo-1494790108755-2616b612b786?w=40&h=40&fit=crop&crop=face" 
              alt="User Profile" 
              className="profile-image"
              onClick={handleProfileClick}
            />
            {showProfileDropdown && (
              <div className="profile-dropdown">
                <div className="dropdown-item" onClick={handleProfilePage}>
                  <span className="dropdown-icon">üë§</span>
                  <span>Profile</span>
                </div>
                <div className="dropdown-divider"></div>
                <div className="dropdown-item" onClick={handleLogout}>
                  <span className="dropdown-icon">üö™</span>
                  <span>Logout</span>
                </div>
              </div>
            )}
          </div>
        </div>
      </header>

      <div className="dashboard-container">
        {/* Left Sidebar */}
        <aside className="sidebar">
          <nav className="sidebar-nav">
            {navigationItems.map((item) => (
              <button
                key={item.id}
                className={`nav-item ${activeTab === item.id ? 'active' : ''}`}
                onClick={() => handleNavigation(item.id)}
              >
                <span className="nav-icon">{item.icon}</span>
                <span className="nav-label">{item.label}</span>
              </button>
            ))}
            <div className="nav-divider"></div>
            <button className="nav-item logout-item" onClick={handleLogout}>
              <span className="nav-icon">üö™</span>
              <span className="nav-label">Logout</span>
            </button>
          </nav>
        </aside>

        {/* Main Content */}
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">User's Dashboard</h1>
            <p className="welcome-message">Welcome back, Amelia</p>
          </div>

          <div className="dashboard-sections">
            {/* Recent Addresses */}
            <section className="dashboard-section">
              <h2 className="section-title">Recent Addresses</h2>
              <div className="address-list">
                {recentAddresses.map((address) => (
                  <div key={address.id} className="address-item">
                    <span className="address-text">{address.address}</span>
                    <button className="view-btn">View</button>
                  </div>
                ))}
              </div>
            </section>

            {/* Bookmarked Addresses */}
            <section className="dashboard-section">
              <h2 className="section-title">Bookmarked Addresses</h2>
              <div className="address-list">
                {bookmarkedAddresses.map((address) => (
                  <div key={address.id} className="address-item">
                    <span className="address-text">{address.address}</span>
                    <button className="view-btn">View</button>
                  </div>
                ))}
              </div>
            </section>

            {/* Predictions */}
            <section className="dashboard-section">
              <h2 className="section-title">Predictions</h2>
              <div className="property-grid">
                {predictions.map((property) => (
                  <div key={property.id} className="property-card">
                    <div className="property-info">
                      <h3 className="property-name">{property.name}</h3>
                      <p className="property-value">Estimated Value: {property.estimatedValue}</p>
                    </div>
                    <div className="property-image">
                      <img src={property.image} alt={property.name} />
                    </div>
                  </div>
                ))}
              </div>
            </section>

            {/* Recommended Properties */}
            <section className="dashboard-section">
              <h2 className="section-title">Properties you might be interested in:</h2>
              <div className="property-grid">
                {recommendedProperties.map((property) => (
                  <div key={property.id} className="property-card">
                    <div className="property-info">
                      <h3 className="property-name">{property.name}</h3>
                      <p className="property-value">Estimated Value: {property.estimatedValue}</p>
                    </div>
                    <div className="property-image">
                      <img src={property.image} alt={property.name} />
                    </div>
                  </div>
                ))}
              </div>
            </section>
          </div>
        </main>
      </div>

      {/* Footer */}
      <footer className="dashboard-footer">
        <div className="footer-left">
          <a href="/terms" className="footer-link">Terms</a>
          <a href="/privacy" className="footer-link">Privacy</a>
        </div>
        <div className="footer-center">
          <span className="copyright">¬© 2024 Valuez. All rights reserved.</span>
        </div>
        <div className="footer-right">
          <a href="/contact" className="footer-link">Contact</a>
          <a href="/disclaimer" className="footer-link">Disclaimer</a>
        </div>
      </footer>
    </div>
  );
};

export default FreeUser;
